import React, { useState } from 'react';

const Applicants = () => {
  const applicantsSectionEnum = {
    SUMMER: 'summer',
    WINTER: 'winter',
    SPRING: 'spring',
    AUTUMN: 'autumn',
  };

  const [applicantsSection, setApplicantsSection] = useState('');

  return (
    <div>
      <div className="tabs is-boxed">
        <ul>
          <li className="is-active"><a href="/#">Search</a></li>
          <li><a href="/#">To Review</a></li>
          <li><a href="/#">Friend Pass</a></li>
          <li><a href="/#">Accepted: Push to Release</a></li>
          <li><a href="/#">GIA</a></li>
          <li><a href="/#">Waitlisted: Push to Release</a></li>
          <li><a href="/#">Accepted: On App</a></li>
          <li><a href="/#">Waitlisted</a></li>
          <li><a href="/#">Banned</a></li>
        </ul>
      </div>
    </div>
  );
};

export default Applicants;
